import React from "react";
import AppLayout from "../components/AppLayout";
import LangdingLayout from "../components/LangdingLayout";

const Home = () => {
  return (
    <LangdingLayout>
      <div>Hello intro!</div>
      <div>
        <p>새로운 분야에</p>
      </div>
    </LangdingLayout>
  );
};

export default Home;
